window.bookSummaryJSON = "<p><b>In the wake of an unexpected homecoming, Jason questions if there is still a place for him in the world he left behind.</b></p> <p>Forced to confront what he has become in his time away, he feels more alien than ever. But his old world is hiding secrets that he never knew.</p> <p>As he starts to unravel what has been hidden from him his entire life, he discovers that not only might he fit in better than ever but he may be exactly what the world needs.</p>"; 
